import React from "react";

import "../styles/content.css"

type Object = {
    x: number;
    y: number;
    type: "chair" | "table" | "sitting";
};

type Info = {
    time: number
    now?: number
    data: Object[]
}

type Props = {
    objects: Info;
};

const countObjects = (objects: Object[], targetType: Object['type']): number => {
    let count = 0;

    objects.forEach((objects) => {
        if (objects.type === targetType) {
            count++
        }
    })
    return (count)
}

const TrafficLight = ({objects}: Props) => {

    const available: number = countObjects(objects.data, "sitting") / countObjects(objects.data, "chair")

    return (
        <div className="TrafficLightContainer">
            <div className="TrafficLightCircle" color="red"></div>
            <div className="TrafficLightCircle" color="yellow"></div>
            <div className="TrafficLightCircle" color="green"></div>
        </div>
    )
}

export default TrafficLight
